import React from "react";
import { SortableContainer } from "react-sortable-hoc";
import List from "@material-ui/core/List";
import DraggableTodo from "./DraggableTodo";

const DraggableTodoList = SortableContainer(({ posts }) => {
  console.log("rendering draggable todolist");
  return (
    <div>
      <List>
        {posts.map((todo, i) => (
          <React.Fragment key={todo._id}>
            <DraggableTodo
              {...todo}
              key={todo._id}
              index={i} /*sortindex={i}*/
            />
            {/* {i < props.posts.length - 1 && <Divider />} */}
          </React.Fragment>
        ))}
      </List>
    </div>
  );
});

export default DraggableTodoList;
